import React from 'react'
import './component3.css'
import ecell_logo from '../../background_images/ecell-logo.png'
const Component3=()=>{
    return(
        <div className="feature_main">
            <p className="feature_title">As Featured In:</p>
            <a className="ecell_img" href="https://ecell.iiit.ac.in/" target="blank"><img src={ecell_logo}/></a>

        </div>
    )
}
export default Component3
